//----------------------------------------------------------------------------------------------------
// Используемые выводы

// A0..A7 микроконтроллера подключается к D7..D0 картриджа. (Внимение! A0 к D7!)

#define DDR_DATA     DDRA
#define PORT_DATA    PORTA
#define PIN_DATA     PINA

#define DDR_CONTROL  DDRD
#define PORT_CONTROL PORTD
#define PIN_CONTROL  PIND

#define MDIR         0x01 // D0 микроконтроллера подключается к MDIR   (вход.  Чтение/запись)
#define GREADY       0x02 // D1 микроконтроллера подключается к GREADY (выход. Данные готовы)
#define GSEL         0x04 // D2 микроконтроллера подключается к GSEL   (вход.  Выбор микросхемы)
#define MODE         0x08 // D3 микроконтроллера подключается к MODE   (вход.  Адрес/данные)

//----------------------------------------------------------------------------------------------------
// Переменные

unsigned int  address;   // Адрес.
unsigned char dataable;  // В буфере есть данные
unsigned char data;      // Буфер для данных
unsigned char grmaccess; // Режим чтения и записи адреса.

//----------------------------------------------------------------------------------------------------
// Чтение данных в буфер

inline void prefetchdata() {
  unsigned int nTmpAddress;
  dataable = 0;
  if(address>=0x6000) { // Область 0x6000 .. 0xFFFF
    nTmpAddress = address - 0x6000;
    nTmpAddress -= ((nTmpAddress >> 13) << 11);
    dataable = 1;
    data = grom[nTmpAddress];   
  }
  address++;
  grmaccess = 0;
}

//----------------------------------------------------------------------------------------------------

void main() {
  // Инициализация переменных
  address = 0;
  grmaccess = 0;
  data = 0;   
                              
  // Микроконтроллер не готов (замыкаем GREADY на землю)
  DDR_CONTROL = GREADY; 
  PORT_CONTROL = 0;
  
  for(;;) {
    // Выбран GROM (GSEL=0)
    if((PIN_CONTROL & GSEL)==0) {
      // Команда        
      switch (PIN_CONTROL & (MDIR|MODE)) {
        case 0x00: // Запись данных, не поддерживается
          prefetchdata();
          break;
        case MDIR: // Чтение данных
          if(dataable) {
            DDR_DATA = 0xFF;
            PORT_DATA = data;
          }
          prefetchdata();
          break;
        case MODE: // Установка адреса
          address <<= 8;
          address |= PIN_DATA;
          grmaccess++;
          if(grmaccess==1) break;
          prefetchdata();
          break;
        case MDIR|MODE: // Чтение адреса (не проверено, так как не используется программами)
          address = ((address&0xff)<<8) | (address&0xff); 
          grmaccess = 0;
          break;
      }             
                       
      // Микроконтроллер готов (освобождаем GREADY)
      DDR_CONTROL &= ~GREADY; 
      PORT_CONTROL = 0;
    
      // Ждем, пока компьютер не обработает данные
      while((PIN_CONTROL & GSEL)==0);  
    
      // Освобождаем шину данных
      DDR_DATA = 0x00;
      PORT_DATA = 0x00;

      // Микроконтроллер не готов (замыкаем GREADY на землю)
      DDR_CONTROL |= GREADY; 
    }
  }
}